import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <p id="prefix title">Hello, my name is</p>
      <p id="name title">Rudy L. Pichola-Flores</p>
      <p id="description title">I'm a software engineer based in Chicago, IL specializing in Computer Networks and Cybersecurity. Currently working at Northwestern Settlement as a web developer, ask me about it!</p>
    </div>
  );
}

export default App;
